import {useState} from "react";

const OptimizeTest = () => {
  const [count, setCount] = useState(1);
  const [text, setText] = useState("");

  const TextView = () => {
    return <>{text}</>
  }

  const CountView = () => {
    return <>{text}</>
  }

  return (
    <div>
      <div>
        <h2>count</h2>
        <button onClick={() => setCount(count + 1)}>+</button>
      </div>
      <div>
        <h2>text</h2>
        <input value={text} onChange={(e) => setText(e.target.value)}/>
      </div>


    </div>
  )
};

export default OptimizeTest;
